package com.code.util;

import org.apache.http.HttpResponse;
import org.apache.http.util.EntityUtils;

import java.util.HashMap;
import java.util.Map;

public class AliyunFont {

    public static void main(String[] args) {
        String imgPath = "D://1.png";
        String result = getImgFont(imgPath);
        System.out.println("result = " + result);
    }

    public static String getImgFont(String imgPath) {
        String result="";
        String host = "https://wenzi.market.alicloudapi.com";
        String path = "/do";
        String method = "POST";
        String appcode = "7b2683bc90d04e4892b61722cee3c2b5";
        Map<String, String> headers = new HashMap<String, String>();
        //最后在header中的格式(中间是英文空格)为Authorization:APPCODE 83359fd73fe94948385f570e3c139105
        headers.put("Authorization", "APPCODE " + appcode);
        //根据API的要求，定义相对应的Content-Type
        headers.put("Content-Type", "application/x-www-form-urlencoded; charset=UTF-8");
        Map<String, String> querys = new HashMap<String, String>();
        Map<String, String> bodys = new HashMap<String, String>();
        bodys.put("detect_direction", "false");
        bodys.put("detect_language", "false");
        bodys.put("image", ImgBase64.getImgStr(imgPath));
        //bodys.put("image", "");
        //bodys.put("image", "");
        bodys.put("language_type", "CHN_ENG");
        bodys.put("probability", "false");


        try {
            /**
             * 重要提示如下:
             * HttpUtils请从
             * https://github.com/aliyun/api-gateway-demo-sign-java/blob/master/src/main/java/com/aliyun/api/gateway/demo/util/HttpUtils.java
             * 下载
             *
             * 相应的依赖请参照
             * https://github.com/aliyun/api-gateway-demo-sign-java/blob/master/pom.xml
             */
            HttpResponse response = HttpUtils.doPost(host, path, method, headers, querys, bodys);
            System.out.println("반환 결과=" + response.toString());
            //获取response的body
            result = EntityUtils.toString(response.getEntity());
        } catch (Exception e) {
            e.printStackTrace();
        }
        return result;
    }
}
